void testMorganStringAns(string& my_ans, string& ans)
{
    int ii{0};

    if (my_ans == ans)
    {
        cout << "answers match" << endl;
        return;
    }

    if (my_ans.size() != ans.size())
    {
        cout << "wrong lengths" << endl;
        if(my_ans.size() < ans.size())
            ii=my_ans.size();
        else
            ii=ans.size();
    }
    else
        ii = ans.size();

    for(int i=0; i <ii; i++)
    {
        if (my_ans.at(i) != ans.at(i))
        {
            cout << i << " " << my_ans.at(i) << " " << ans.at(i) << endl;  
            return; 
        }
    }

}

